import "../styles/components-style/Cards.css"

function Cards({id, cover, title}) {
    return (
            <li className="elementCard" key={id}>
            <img src={cover} alt='' className="cover"/>
            <p className="titre">Titre de la location, {title}</p>
            </li>
    )
};

export default Cards;

